function Footer() {
   return (
      <footer className="footer">
         <div className="footer-inner">
            <button className="logo">
               <img src="/logo.png" alt="logo" className="logo-icon" />
               <span className="footer-text">Паровозик Томас</span>
            </button>
         </div>
      </footer>
   );
}

export default Footer;
